    '/get/create', roomController.getRoomCreate
);
router.get(
    '/get/not-joined', roomController.getRoomNotJoined
);
router.get(
    '/get/joined', roomController.getRoomJoined
);
router.get(
    '/get/members', roomController.getMembers
);
export default router;

